import React, {useState, useEffect} from "react";
import "./menu.css";
import { Config } from "../../constant/Index";

function Menu() {
    const [data, setData] = useState()
    useEffect(() => {
        // Fetch data from the API and update the state
        const fetchData = async () => {
          try {
            const response = await fetch(Config.serverUrlProduct);
            const json = await response.json();
            setData(json.data);
          } catch (error) {
            console.error('Error fetching data:', error);
          }
        };
    
        fetchData();
      }, []);
  return (
    <>
      <div className="menu__section">
        <div className="category__filter">
          <div className="categories">
            <a href="@" className="category active">
              ALL
            </a>
            <a href="@" className="category">
              Burger
            </a>
            <a href="@" className="category">
              Pizza
            </a>
            <a href="@" className="category">
              Icecream
            </a>
            <a href="@" className="category">
              Deserts
            </a>
            <a href="@" className="category">
              Deserts
            </a>
          </div>
          <div className="filter">
            <span className="sort">Sort by :</span>
            <div className="selected" id="sort">
              <span>Price</span>
              <i className="bx bx-chevron-down" />
            </div>
            <div className="options" id="options">
              <span className="option">Rating</span>
              <span className="option">Price</span>
              <span className="option">Newest</span>
              <span className="option">Oldest</span>
            </div>
          </div>
        </div>

       {
        data.map((data)=>(
            <div key={data.id}  className="menu__cards">
            <div className="card">
              {/* card rating */}
              <div className="rating">
                <h4>4.5</h4>
                <i className="fa-solid fa-star" />
                <span>(25+)</span>
              </div>
              <div className="heart">
                <i className="fa-regular fa-heart" onclick="changeClass(this)" />
              </div>
              <img src="img/cardimg.png" alt="product img" />
              <div className="menu__content">
                <div className="title__price">
                  <h3 className="card__title">Ground Beef Tacos</h3>
                  <span className="price">Rs 225</span>
                </div>
                <div className="time">
                  <i className="fa-solid fa-stopwatch" />
                  <span>10-15 mins</span>
                </div>
                <div className="food__type">
                  <span className="type">Burger</span>
                  <span className="type">Chicken</span>
                  <span className="type">Fast Food</span>
                </div>
              </div>
            </div>
          </div>
        ))
       }
      </div>
    </>
  );
}

export default Menu;
